CREATE TABLE `usuario` (
  `Cedula` int(11) NOT NULL,
  `Password` varchar(50) NOT NULL,
  `Nombre` varchar(50) NOT NULL,
  `Apellido` varchar(50) NOT NULL,
  `Correo` varchar(50) NOT NULL,
  `Direccion` varchar(50) NOT NULL,
  `Telefono` varchar(50) NOT NULL,
  `TipoUsuario` varchar(50) NOT NULL,
  `ColorPantalla` enum('Dark','Bright') NOT NULL DEFAULT 'Dark',
  `UsuarioActivo` enum('Activo','Inactivo') NOT NULL DEFAULT 'Inactivo',
  `MomentoUltimaActividad` datetime NOT NULL DEFAULT '0001-01-01 01:00:00',
  `UltimoLogin` datetime NOT NULL DEFAULT '0001-01-01 01:00:00',
  `SueldoBruto` float NOT NULL,
  `tokenSeguridad` tinyint(4) NOT NULL DEFAULT '0',
  `foto` longblob,
  PRIMARY KEY (`Cedula`),
  KEY `rol_idx` (`TipoUsuario`),
  CONSTRAINT `rol` FOREIGN KEY (`TipoUsuario`) REFERENCES `tipoempleado` (`Rol`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
